      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE NOT col0 IN ( + col0 / + col0, ( - - 21 ) + - + col1, 1 * + col0 + ( + col0 ) + + + 31 + - col0 );
  - name: tab2

